#RareDanglesPB Alert from Czech League! 

@nhlbruins legend David Krejci (@dkrejci46 ) uses a forehand flip to dance over the stick of oncoming opponent before rifling one far side.

Krejci has 5 goals and 1 assist in 4GP so far this season.

Ball hockey enforcers in a non hitting league are the toughest breed. 

(Video Source: @spittinchiclets via 
@sweater_vest_optional)
